{"operationName":"toolDecisions","variables":{"id":"101231775369249797"},"query":"query toolDecisions($id: ID!, $after: String) {
  tool(id: $id) {
    stackDecisions(first: 6, after: $after) {
      edges {
        node {
          user {
            id
            username
            title
            companyName
            imageUrl
            thumbUrl
            displayName
            __typename
          }
          company {
            imageUrl
            thumbUrl
            name
            path
            features {
              slug
              __typename
            }
            __typename
          }
          link {
            url
            title
            __typename
          }
          publicId
          createdAt
          id
          htmlContent
          viewCount
          upvotesCount
          services {
            name
            path
            id
            imageUrl
            thumbUrl
            __typename
          }
          topics {
            name
            id
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}
"}
